import React, { Component } from "react";
import { Navbar, Nav, Form, FormControl, Button } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import Card from "../Components/Card";
import "./Profile.css";

class Profile extends Component {
  state = {
    user: null,
    major: null,
    userPicture: null,
    listings: []
  };

  componentDidMount() {
    // fetch user
    fetch("https://jsonplaceholder.typicode.com/users")
      .then(res => res.json())
      .then(data => {
        this.setState({
          user: data[0].name,
          major: "Computer Science B.S."
        });
      });
  }

  render() {
    var { user, major, listings } = this.state;

    return (
      <div>
        <Navbar bg="primary" variant="dark">
          <Navbar.Brand href="#Main">BookHub</Navbar.Brand>
          <Nav className="mr-auto">
            {/* buttons for the Nav bar will got here  
                         here is an example:
                         <Nav.Link href="#home">Home</Nav.Link>
                         */}
          </Nav>
          <Form inline>
            <FormControl
              type="text"
              placeholder="Search"
              style={{ width: "370px" }}
              className="mr-sm-2"
            />
            <Button variant="outline-light">Search</Button>
          </Form>
        </Navbar>
        <div className="Top">
          <section class="jumbotron text-center">
            <header class="page-cover">
              <div class="text-center">
                <img
                  src="https://icon-library.net/images/default-user-icon/default-user-icon-8.jpg"
                  width="140"
                  height="140"
                  border="0"
                  class="rounded-circle"
                />
                <h2 class="h4 mt-2 mb-0">{user}</h2>
                <p class="text-muted">{major}</p>
                <button class="btn btn-primary" type="submit">
                  Message
                </button>
                {/* <hr /> */}
              </div>
            </header>
          </section>
        </div>
        <div class="Inner">
          <h2 class="text-center">
            <strong>Listings</strong>
          </h2>
          <div class="card" style={{ width: "18rem" }}>
            <img
              src="https://prodimage.images-bn.com/pimages/9780262033848_p0_v1_s550x406.jpg"
              class="card-img-top"
              alt="..."
            />
            <div class="card-body">
              <h5 class="card-title">Introduction to Algorithms</h5>
              <a href="#" class="btn btn-primary">
                Inquire
              </a>
              <p class="d-inline-block">$10.00</p>
            </div>
          </div>
        </div>
      </div>
    );

    const list = listings.map(listing => {
      return <div></div>;
    });
  }
}

export default Profile;
